Adult habitus
[Previously described by 
Jewett (1966)
]. Male forewing length 15.0 mm (n = 1); female forewing length 19.0- 
20.5 mm
(n = 3). Body dark brown, wings transparent with dark veins. Head dark brown with yellow markings; pronotum dark with a narrow, median yellow stripe. Antennae brown, cerci pale brown (
Fig. 1
). Abdominal gills present on ventrolateral corners of segments 1-7 (
Fig. 9
).

Male epiproct and 10 
th
tergal complex

[Previously described by 
Jewett (1966)
]. Hemiterga of tergum 10 attenuated to form digit-like curved structures (
Fig. 3
). Black, Y-shaped, prominent epiproct anchor located anteromedially between hemiterga, and a large membranous cowl extends posteriorly enclosing epiproct. Epiproct bent sharply at a near right angle at posteroventral region of cowl (
Fig. 4
); most of epiproct very darkly sclerotized within cowl, but a short apical section lacks strong sclerotization. Much of epiproct surface covered with fine, densely packed setae. Epiproct tip in lateral aspect slightly excavated and not quite as wide as the more basally located and heavily sclerotized section. In dorsal aspect, a pair of darkly sclerotized paragenital plates are imbedded in the membranous cowl. Lateral stylets not evident. Aedeagus glabrous and recurved over terminal abdominal segments (
Fig. 8
). Dorsal aspect narrow, expanding into large, lateral lobes, narrowing abruptly with a rounded apex (
Fig. 7
). Lateral aspect with relatively constant width from base to anterior lobes, apex pointing downward and terminating in rounded tip (
Figs. 8-9
).

Female subgenital plate
[Previously described by 
Siegfried et al. (1977)
]. Subgenital plate broad basally, narrowed apically and bearing a variably shaped shallow median notch (
Figs. 5-6
). Most of sternum 9 membranous, but posterior margin bearing a slender, black, transverse sclerite. Midlateral membranous field of sternum 9 also bearing a pair of subtriangular sclerites.

Egg
(n=8) [Previously described by 
Siegfried et al. (1977)
and 
Stark & Szczytko (1984
, 1988)]. Total length 623 μm, egg body length 561 μm, egg collar length 62 μm, egg diameter 419 μm, collar diameter 129 μm (
Figs. 10-12
). Chorionic surface covered throughout with hexagonal follicle cell impressions (FCI) (
Figs. 10-15
). Thick FCI walls surround a single, or a pair of pits (
Fig. 15
). FCI width near micropylar region 16-19 μm. Micropyles form irregular rows near midlength; orifices small and often surrounded by rosettes composed of modified FCI’s (
Fig. 15
). Anchor hatshaped with turned up brim (
Fig. 13
).

Oroperla barbara

larvae grew rapidly between July and October at all four stations, but then slowed or stopped during the winter months, this stasis continuing into spring when adults emerged (
Figs. 22-25
). Mature larvae became sparse or absent after late March-early May, the period when adults emerged and eggs began to incubate. Adults emerged between March and June, occurring earlier in the year at lower elevations (
619-978 m
) and later at higher elevations (
1536-1658 m
). A new cohort of smaller larvae became evident in the growth chart during June-July and reached head capsule widths> 2.0 mm by early August.

These growth patterns appear to document an annual life cycle for 

O. barbara
;

however, additional data on early-instar growth and egg incubation are needed to confirm this interpretation. For example, except for incubating 
one egg
mass to obtain first instar larvae (head width of 
0.4 mm
), early life stages (head width <
1.5 mm
) were not effectively sampled during this growth study. Therefore, the actual progression of growth between first instars and young larvae was unknown. Our laboratory egg incubation results showed that hatching occurred more than 70 days after oviposition, which occurred from late March to early June. At all stations except the lowest, this incubation delay pushed back the start of larval growth beyond June-July, when an earlier cohort (head width> 1.0- 
1.5 mm
) already existed in the stream. For the upper three stations, an annual life cycle seems possible only if egg incubation lasted for 30 days or less.
